- - cot: "The error occurs because negative dimensions are supplied for the 'input'\
      \ Tensor. In TensorFlow, dimensions should be non-negative integers. Additionally,\
      \ there seems to be repeating values in the 'axis' attribute which may also\
      \ be the cause of the problem depending on the operation. \n\nTo fix the error,\
      \ ensure that all dimensions for the 'input' Tensor are non-negative, and that\
      \ the 'axis' attribute does not contain repeating values."
    length: 1
    target:
      choosen_dtype:
        axis: list[int]
        input: tensor
        keep_dims: bool
        name: str
      msg: negative dimensions are not allowed
      package: tensorflow
    txt: all(dimension >= 0 for dimension in input.shape) and len(axis) == len(set(axis))
